INSERT INTO `mdl_question` VALUES (1,11,0,'Чем вы увлекаетесь?','<p>Кратко расскажите о своих хобби<br></p>',1,'<p>спуни вуни муму<br></p>',1,1.0000000,0.3333333,'shortanswer',1,'192.168.1.33:5555+170220102308+IjmiCk','192.168.1.33:5555+170220102308+skVq4u',0,1487586188,1487586188,14,14),(2,5,0,'Приведение_NaN','<p>К какому значению приводится неявным приведением типа следующая последовательность инструкций и вычислений:</p><p><img src=\"@@PLUGINFILE@@/Screenshot%202017-02-20%2013.24.15.png\" alt=\"\" width=\"135\" height=\"60\" role=\"presentation\" class=\"img-responsive atto_image_button_text-bottom\"><br></p><p><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'192.168.1.33:5555+170220102725+GPmlK5','192.168.1.33:5555+170220102725+RSCxni',0,1487586445,1487586445,2,2),(3,11,0,'Про честь','2+2*2 = ?<br>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'192.168.1.33:5555+170220102726+m1j61s','192.168.1.33:5555+170220102726+68cu5F',1,1487586446,1487586446,14,14),(4,10,0,'Что мы увидим в консоли','<p>Что отобразится в консоли после ввода следующего кода:</p><p>var a = 5;&nbsp;</p><p>&nbsp;function test() {&nbsp;</p><p>&nbsp; &nbsp; console.log(a);\r\n	a = 2;&nbsp;</p><p>&nbsp; &nbsp; console.log(a);\r\n	var a = 3;&nbsp;</p><p>&nbsp; &nbsp; console.log(a);&nbsp;</p><p>&nbsp;}&nbsp;</p><p>&nbsp;test();&nbsp;</p><p>&nbsp;console.log(a);<br></p>',1,'',1,10.0000000,0.3333333,'shortanswer',1,'192.168.1.33:5555+170220103106+LYq8Yw','192.168.1.33:5555+170220103106+Rc28od',0,1487586666,1487586666,12,12),(5,12,0,'Деструктуризация','<p>Как называется [a,b]=[b,a]?<br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'192.168.1.33:5555+170220103401+cEkB4i','192.168.1.33:5555+170220103401+oNEBgj',0,1487586841,1487586841,10,10),(6,6,0,'Инкремент','<p>Какой будет вывод после выполнения данного выражения: let i = 5; i++ + ++i; ?</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'192.168.1.33:5555+170220103425+7RMuLZ','192.168.1.33:5555+170220103800+2HRMla',0,1487586865,1487587080,4,4),(7,