0,1494557145,1494557145,2,2),(101,52,0,'NodeList (копия)','<p>Какой тип структуры возвращает метод document.querySelectorAll?</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+yWFJsb','koddr.xyz+170512024545+dC57uY',0,1494557145,1494557145,2,2),(102,52,0,'Reflect (копия)','<p>Назовите статический класс (объект) современного JavaScript, позволяющий переопределять в рамках метапрограммирования операции по отношению к объектам, используя Proxy в качестве обёртки вокруг каждого конкретного объекта.</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+jL4kAv','koddr.xyz+170512024545+UBAu3o',0,1494557145,1494557145,2,2),(103,52,0,'rest','<p><p>Пусть массив m есть [3,2];</p>\r\n<p>Сколько различных элементов будет в массиве [1,2, ...m, 1] ?</p><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+eMqtgm','koddr.xyz+170512024545+KUmGCZ',0,1494557145,1494557145,2,2),(104,52,0,'truish','<p>Допустим, мы создали неудаляемое свойство с помощью Reflect.defineProperty.</p><p>Кто-то пытается теперь переопределить это свойство, а в ловушке мы возвращаем истину как реакцию на это действие. Тогда будет брошено исключение:</p><p><img src=\"@@PLUGINFILE@@/2017-04-03_06-35-45.png\" alt=\"\" width=\"1096\" height=\"138\" role=\"presentation\" class=\"img-responsive atto_image_button_text-bottom\"><br></p><p>Но какое слово в его формулировке закрашено?</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+jugdQj','koddr.xyz+170512024545+9tj2ie',0,1494557145,1494557145,2,2),(105,52,0,'undefined','<p><p>Какое значение возвращает функция в JavaScript, если в определении функции не указано явно, что она возвращает?</p><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+8tIdVA','koddr.xyz+170512024545+G9hht5',0,1494557145,1494557145,2,2),(106,52,0,'var-let','<p><p>Сколько раз будет выведена единица, если в этом коде всюду <b>let </b>заменить на <b>var</b>?</p><br></p><p><img src=\"@@PLUGINFILE@@/2017-04-03_06-04-16.png\" alt=\"\" width=\"971\" height=\"48\" role=\"presentation\" class=\"img-responsive atto_image_button_text-bottom\"><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+bOVDVR','koddr.xyz+170512024545+GFvhhi',0,1494557145,1494557145,2,2),(107,52,0,'void','<p><p>В нижеследующим коде какой оператор используется для игнорирования возврата значения функцией?</p>\r\n<p>((x,y,f)=&gt;void setTimeout(f.bind(null,x+y),x*1000))(3,10,x=&gt;console.log(`Результат: ${x}`));</p><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+kdsCr8','koddr.xyz+170512024545+6qEfIJ',0,1494557145,1494557145,2,2),(108,52,0,'λ','<p>Одной буквой запишите, как &nbsp;по-другому называется безымянная функция (см. пример ниже), что отсылает к функциональному исчислению, созданному Алонзо Чёрчем?\r\n<p><b>(x=&gt;x*x)(5)</b></p></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+FDYRpB','koddr.xyz+170512024545+ocjZc3',0,1494557145,1494557145,2,2),(109,52,0,'арность','<p><p>Назовите синоним слова \"местность\" (например, двухместность), применяемого по отношению к операторам (местность оператора умножения равна двум), и означающего количество операндов.</p><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+VIWeEJ','koddr.xyz+170512024545+792emv',0,1494557145,1494557145,2,2),(110,52,0,'замыкание (копия)','<p><p class=\"p1\">Как называется способность функций языка JavaScript сохранять значения переменных, определённых в родительской функции, если они возвращаются этими родительскими функциями?</p><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+MuhAgq','koddr.xyz+170512024545+tDgLUP',0,1494557145,1494557145,2,2),(111,52,0,'иммутабельность','<p>Назовите свойство функций JavaScript, означающее, что тело единожды созданной функции нельзя изменить.</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+OpwBZ3','koddr.xyz+170512024545+6ziH8J',0,1494557145,1494557145,2,2),(112,52,0,'класс DOM для кастомных событий (копия)','<p>Назовите класс DOM/ JavaScript для создания собственных пользовательских событий</p><p>(сообщений, обрабатываемых слушателями событий типа \'click\')</p><p><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+wtAFAQ','koddr.xyz+170512024545+7qhWJC',0,1494557145,1494557145,2,2),(113,52,0,'косые!!!','<p>Напишите десятичный код (<b>только число</b>) символа, на который можно заменить скобки в записи<br></p><p>\r\n<p>так чтобы это выражение возвращало тот же результат<br></p><img src=\"@@PLUGINFILE@@/2017-04-03_06-16-01.png\" alt=\"\" width=\"905\" height=\"49\" role=\"presentation\" class=\"img-responsive atto_image_button_text-bottom\"><br></p><p><br></p><p>String.fromCharCode(0x60).charCodeAt(0).toString(0x10)<br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+YAoqBz','koddr.xyz+170512024545+Y9bBZX',0,1494557145,1494557145,2,2),(114,52,0,'ловушка trap (копия)','<p>Назовите на русском или английском языке специальную функцию в составе прокси-объекта,</p><p>которая срабатывает, подобно слушателю события, при попытках удалять свойства,</p><p>переназначать их атрибуты и т.п.</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+oQdrnQ','koddr.xyz+170512024545+rVKZ1X',0,1494557145,1494557145,2,2),(115,52,0,'Назовите спецсимвол итерации (копия)','<p>Назовите специальный Символ в виде ключа метода, возвращающего итератор в итерируемой структуре.</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+jkgc2a','koddr.xyz+170512024545+hDWe5M',0,1494557145,1494557145,2,2),(116,52,0,'Приведение_NaN','<p>К какому значению приводится неявным приведением типа следующая последовательность инструкций и вычислений:</p><p><img src=\"@@PLUGINFILE@@/Screenshot%202017-02-20%2013.24.15.png\" alt=\"\" width=\"135\" height=\"60\" role=\"presentation\" class=\"img-responsive atto_image_button_text-bottom\"><br></p><p><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+UkuWSC','koddr.xyz+170512024545+uYQYGo',0,1494557145,1494557145,2,2),(117,52,0,'рекурсия-в-объекте','<p>Как с помощью выражения, состоящего из 6 символов,</p><p>получить факториал числа 5, если дано, что:</p><p><img src=\"@@PLUGINFILE@@/2017-04-03_05-47-55.png\" alt=\"\" width=\"600\" height=\"269\" role=\"presentation\" class=\"img-responsive atto_image_button_text-bottom\"><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512024545+cS1xCG','koddr.xyz+170512024545+QC4mGC',0,1494557145,1494557145,2,2),(118,43,118,'Случайный (progress-recursion)','0',0,'',0,1.0000000,0.0000000,'random',1,'koddr.xyz+170512025127+7DjFYF','koddr.xyz+170512025127+TQ3KHD',0,1494557487,1494557487,2,2),(119,54,0,'прототип','<p><span lang=\"RU\">Что является прототипом объекта, созданного\r\nинициализатором литерала объекта?</span><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025458+1Gr8Ls','koddr.xyz+170512025458+AmmciI',0,1494557698,1494557698,2,2),(120,54,0,'package.json','<p><span lang=\"RU\">Назовите стандартное имя&nbsp; файла (с расширением) дескрипторов пакетов </span>CommonJS<span lang=\"RU\">, в\r\nкотором задаются зависимости для современного веб-приложения на </span>JavaScript<br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025541+FxhkTo','koddr.xyz+170512025541+b6jqKY',0,1494557741,1494557741,2,2),(121,54,0,'default','<p><span lang=\"RU\">Какое ключевое слово </span>ES<span lang=\"RU\">2015\r\nпозволяет обозначить экспортируемую сущность как доступную для импорта по\r\nумолчанию?</span><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025628+RrM9nk','koddr.xyz+170512025628+tr7bhS',0,1494557788,1494557788,2,2),(122,56,0,'Y-комбинатор','<p>Каким будет результат вычисления этого выражения JavaScript:</p><p><img src=\"@@PLUGINFILE@@/1.png\" alt=\"\" width=\"564\" height=\"20\" role=\"presentation\" style=\"vertical-align:text-bottom; margin: 0 .5em;\" class=\"img-responsive\">({a},{b})<br></p>',1,'',1,1.0000000,0.3333333,'calculatedsimple',1,'koddr.xyz+170512025953+5CdoLr','koddr.xyz+170512025953+nnrzaT',0,1494557993,1494557993,2,2),(123,56,0,'Формула Хартли (прямое применение)','<p>Предположим, что мы получили информацию о количестве бит, израсходованных на кодирование одного пиксела в изображении, и оно равно {I}. Каким является количество цветов, доступных в изображении?</p>',1,'',1,1.0000000,0.3333333,'calculatedsimple',1,'koddr.xyz+170512025953+vJZQwh','koddr.xyz+170512025953+2YqJrV',0,1494557993,1494557993,2,2),(124,56,0,'$CFG->wwwroot','<p>Назовите полное имя ключа настройки Moodle, где прописывается IP-адрес или доменное имя, чтобы можно было открыть его в локальной сети или в Интернете.</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025953+4ZRGPP','koddr.xyz+170512025953+rSM93a',0,1494557993,1494557993,2,2),(125,56,0,'activity','<p><span style=\"color: rgb(51, 51, 51); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;  display: inline !important; float: none;\">Как в терминологии Moodle называется (на английском языке) то, что в переводных вариантах называется «Элемент» в добавлении элемента или ресурса в теме?</span><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025953+LEHrNL','koddr.xyz+170512025953+WXHpqB',0,1494557993,1494557993,2,2),(126,56,0,'base64','<p>При экспорте тестовых вопросов из Moodle (MoodleXML) в каком формате встраиваются внутрь файла изображения?</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025953+ndtDPk','koddr.xyz+170512025953+K3x0xA',0,1494557993,1494557993,2,2),(127,56,0,'email','<p>Назовите имя поля №13 (считая от 1) в таблице пользователей Moodle</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025953+iy86t3','koddr.xyz+170512025953+Nz7MVS',0,1494557993,1494557993,2,2),(128,56,0,'install.php','<p>При первичной установки Moodle первым происходит запуск файла index.php - а вторым?</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025953+3d2i0K','koddr.xyz+170512025953+VG9CDX',0,1494557993,1494557993,2,2),(129,56,0,'mdl_user','<p><span style=\"color: rgb(51, 51, 51); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;  display: inline !important; float: none;\">Каково название таблицы пользователей в БД системы Moodle?</span><br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025953+cA0lPE','koddr.xyz+170512025953+dTJrWe',0,1494557993,1494557993,2,2),(130,56,0,'quiz','<p>Как в терминологии Moodle называется (на английском языке) тест, состоящий из вопросов?</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025953+azLByK','koddr.xyz+170512025953+WBfdHE',0,1494557993,1494557993,2,2),(131,56,0,'Terminate','<p>Без скобок и любых лишних знаков напишите название метода SCORM API, гарантирующего запись значений (баллов и т.п.) в базу данных LMS в финале процесса работы с пакетом.</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025953+k9fAe2','koddr.xyz+170512025953+OwsOg2',0,1494557993,1494557993,2,2),(132,56,0,'zip','<p>В каком формате распространяются SCORM-пакеты?</p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'koddr.xyz+170512025953+WtdOEE','koddr.xyz+170512025953+3c5yb8',0,1494557993,1494557993,2,2),(133,56,0,'Назовите имя файла в составе SCORM-пакета..','<p>Назовите имя файла в составе SCOR